/** Compute a hash code for hashing us
 * @return the hash code
 */
@Override
public int hashCode() {
  return Float.floatToIntBits(getBoost())
          + Float.floatToIntBits(tieBreakerMultiplier)
          + disjuncts.hashCode();
}

