/** Compute a hash code for hashing us
 * @return the hash code
 */
@Override
public int hashCode() {
  int h = super.hashCode();
  h = 31 * h + Float.floatToIntBits(tieBreakerMultiplier);
  h = 31 * h + disjuncts.hashCode();
  return h;
}

